import React from 'react'
import ReactPlayer from 'react-player/file'

function Projects() {
   return (
      <div class="video">
        <ReactPlayer
            className='react-player fixed-bottom' 
            url= 'videos/backdrop.mp4'
            controls = {true}
            playing = {true}
        /> 
    </div>
   )
};
export default Projects;
